import ListGroup from "react-bootstrap/ListGroup";

const MisList = ({ mis, solInsts }) => {
  return (
    <>
      <ListGroup as="ul">
        {mis.length === 0
          ? "No"
          : mis.map((mis) => (
              <ListGroup.Item as="li" key={mis.id}>
                <h4>{mis.name}</h4>
                {solInsts.map((inst) =>
                  inst.id === mis.solInstId ? " " + inst.name : ""
                )}
                <br />
                <h6>{mis.email}</h6> <br />
                Contact: {mis.contact} <br />
              </ListGroup.Item>
            ))}
      </ListGroup>
    </>
  );
};

export default MisList;
